('BOD-1844', 'กาชงชาแบบกด', 1760, 'Commercial Coffee Machines', 'ตัวกาน้ำชานั้นมีความคงทน สามารถทำความสะอาดในเครื่องล้างจานได้\r\n', 'ควาจุ 1 ลิตร/ 32 ออนซ์\r\n', NULL),
('BOD-1924-16', 'แก้วชงกาแฟแบบกด', 3250, 'Commercial Coffee Machines', 'ความจุ 0.5 ลิตร/17ออนซ์\r\n', NULL, NULL),
('BUO-111173', 'เครื่องชงกาแฟ แบบหยด 1-4 ถ้วย', 990, 'Commercial Coffee Machines', 'มีเพลทอุ่นกาแฟพร้อมเสิร์ฟได้ตลอดเวลา\r\n', 'มีขีดบอกระดับน้ำ โถแก้วสามารถล้างทำความสะอาดได้ง่าย\r\n', 'โถกาแฟจุ 0.6 ลิตร\r\n'),
('BUO-118283', 'เครื่องชงเอสเพรสโซ', 5700, 'Commercial Coffee Machines', 'เครื่องชงกาแฟเอสเพรสโซขนาดกะทัดรัด ประหยัดพื้นที่ แต่ประสิทธิภาพสูง\r\n', 'ท่อไอน้ำสตีมโฟมนมสำหรับแคพพุชชิโนและการจัดเตรียมเครื่องดื่มร้อน\r\n', 'แทงก์น้ำถอดออกได้จุ 0.7 ลิตร สะดวกสำหรับการเติมน้ำได้ตลอดเวลา\r\n'),
('BUO-252312', 'เครื่องชงกาแฟ 2 ถ้วย สีขาว', 990, 'Commercial Coffee Machines', 'พร้อมแก้วเซรามิก 2 ใบ ทำความสะอาดด้วยเครื่องล้างจานได้\r\n', 'มีถาดรองกาแฟหยด สามารถถอดล้างทำความสะอาดได้\r\n', 'สามารถทำกาแฟได้ครั้งละ 2 แก้ว ขนาดแก้ว 0.3 ลิตร\r\n'),
('ISI-1020', 'ขวดทำโซดา', 3400, 'Accessories', 'ขวดทำจากสเตนเลสคุณภาพดี\r\n', 'วาล์วควบคุมความดันเพื่อสะดวกและปลอดภัยในการใช้งาน\r\n', 'ความจุ 1 ลิตร\r\n'),
('ISI-1570', 'ขวดทำวิปครีม 0.5 ลิตร', 2990, 'Accessories', 'ทำจากสเตนเลสอย่างดี\r\n', 'ที่บีบวิปครีมบีบง่าย สามารถกะปริมาณได้อย่างแม่นยำ\r\n', 'ถอดล้างทำความสะอาดได้ง่าย\r\n'),
('ISIA-0079', 'หลอดก๊าซวิปครีม', 205, 'Accessories', 'iSi เป็นผู้นำระดับโลกในเรื่องขวดทำวิปครีมและหลอดก๊าซมีประสบการณ์มายาวนาน\r\n', 'แต่ละหลอดบรรจุก๊าซไนตรัสออกไซด์บริสุทธิ์ 7.5 กรัม\r\n', 'ตัวหลอดเคลือบเงิน (silver coating)เพื่อป้องกันสนิมและเคลือบติดผิวโลหะได้ดี\r\n'),
('LAP-CAFE2M', 'เครื่องชงกาแฟเอสเพรสโซ แคพพุชชิโน ', 126000, 'Commercial Coffee Machines', 'เครื่องชงกาแฟแบบ 2 หัวชง ก้านสตีมนม 1 ก้าน และหัวจ่ายน้ำร้อน 1 หัว\r\n', 'ควบคุมปริมาณของกาแฟด้วยระบบกึ่งอัตโนมัติ\r\n', 'หม้อต้มทำจากทองแดงขนาดใหญ่ 10 ลิตร\r\n'),
('LAP-DMB', 'เครื่องชงกาแฟพร้อมเครื่องบดเมล็ดกาแฟ', 49800, 'Commercial Coffee Machines', 'เครื่องบดเมล็ดกาแฟในตัว ปรับความหยาบ-ละเอียดได้ 7 ระดับ ขนาดบรรจุเมล็ดกาแฟ 150 กรัม\r\n', 'ฟิลเตอร์ 2 ขนาด: 1 ถ้วย(8 กรัม) และ 2 ถ้วย (16 กรัม) พร้อมท่อพ่นไอน้ำสำหรับการทำโฟมนม\r\n', 'แทงค์น้ำมีความจุถึง 3.5 ลิตร\r\n'),
('LAP-JN', 'เครื่องบดเมล็ดกาแฟ', 18600, 'Coffee Grinder', 'ความละเอียดของเมล็ดกาแฟที่บดแล้วนับเป็นสิ่งสำคัญที่จะทำให้ได้รสชาติกาแฟที่ดี เครื่องจะโม่เมล็ดกาแฟได้ละเอียด หรือ หยาบ ตามต้องการด้วยแผ่นเหล็ก 2 แผ่น โดยใส่เมล็ดกาแฟได้ครั้งละ 250 กรัม\r\n', NULL, NULL),
('LAP-PUB1EVN', 'เครื่องชงกาแฟเอสเพรสโซ แคพพุชชิโน ', 129000, 'Commercial Coffee Machines', 'หัวจ่ายน้ำร้อน 1 หัว และก้านตีโฟมนม 1 ก้าน ซึ่งสามารถถอดเปลี่ยนเป็นชุดทำโฟมนมแบบอัตโนมัติได้\r\n', 'ควบคุมปริมาณของกาแฟด้วยระบบอัตโนมัติ\r\n', 'หม้อต้มทำจากทองแดง ความจุ 4ลิตร\r\n'),
('SEV-3590', 'เครื่องตีโฟมนม', 460, 'Accessories', 'ทำโฟมนมเพียงใช้เวลาไม่กี่วินาที ช่วยประหยัดเวลา\r\n', 'ทำความสะอาดง่าย\r\n', 'ใช้แบตเตอรี่ขนาด 1.5 V จำนวน 2 ก้อน \r\n'),
('SEV-3874', 'เครื่องบดเมล็ดกาแฟ', 3500, 'Coffee Grinder', 'พลิดเพลินไปกับกลิ่นหอมของกาแฟสดทุกวันด้วยเครื่องบดเมล็ดกาแฟไฟฟ้า\r\n', 'ปรับความหยาบ-ละเอียดได้\r\n', 'ตั้งปริมาณการบดได้\r\n'),
('SEV-9685', 'เครื่องทำโฟมนมร้อน-เย็น ปรับอุณหภูมิได้ 4 ระดับ', 6950, 'Accessories', 'ปลอดภัยและประหยัดด้วยระบบแม่เหล็กไฟฟ้า (Induction) กระจายความร้อนได้รวดเร็ว\r\n', 'ทำโฟมนมร้อน-เย็นได้รวดเร็วภายในไม่กี่นาที เพิ่มรสชาติให้กับกาแฟทั้งแคพพูชชิโน ลาเต้\r\n', 'โถทำโฟมสเตนเลสทำความสะอาดได้ง่ายสามารถล้างกับเครื่องล้างจานได้\r\n'),
('TRU-0872035', 'แก้วชงชาพกพา', 660, 'Accessories', 'แก้วชงชาสามารถชงชาจากใบชาหรือถุงชาได้ ประหยัดเวลา และพกพาได้\r\n', 'ตัวแก้วทำจากพลาสติกอย่างดีสองชั้นช่วยเก็บความร้อนได้นานถึง 2 ชั่วโมง\r\n', 'ความจุ 16 ลิตร\r\n'),
('TRU-0998005R', 'ที่ชงชาซิลิโคนพร้อมฝาปิด', 330, 'Accessories', 'ทั้งชุดทำจากซิลิโคน ยืดหยุ่นได้ดี\r\n', 'เข้าไมโครเวฟและเครื่องล้างจานได้ ปลอดภัย\r\n', 'ทำจากซิลิโคนที่เหมาะสำหรับใช้กับอาหาร\r\n');

