('ANC-91625', 'ภาชนะอบแก้วลายตะกร้าสาน', 920, 'Casseroles', 'ทนความร้อนสูง เข้าเตาไมโครเวฟ และเตาอบไฟฟ้าได้\r\n', 'ความจุ 2 ลิตร เส้นผ่าศูนย์กลาง 23 ซม.\r\n', 'ล้างทำความสะอาดได้ง่ายและใช้ล้างในเครื่องล้างจานได้\r\n'),
('CHA-103703', 'กระทะเหล็กหล่อพร้อมฝาแก้ว สีแดง', 10300, 'Cast Iron Cookware', 'ฝาหม้อมีน้ำหนักที่เหมาะสมและปิดสนิท ทำให้เก็บความร้อนได้ดีและทำให้รสชาติอาหารกระจายเข้าเนื้อได้อย่างทั่วถึง\r\n', 'สามารถใช้กับทุกแหล่งความร้อน เช่น เตาอบ เตาไฟฟ้า เตาแม่เหล็ก\r\n', 'ขนาดเส้นผ่านศูนย์กลาง 36 เซนติเมตร\r\n'),
('CHA-302401', 'หม้อนึ่ง 2in1', 11980, 'Cast Iron Cookware', 'หม้อนึ่ง 2 in 1 ส่วนหม้อทำจากเหล็กหล่อ\r\n', 'หม้อนึ่งและฝาทำจากแก้ว\r\n', 'ใช้ได้กับเตาทุกประเภท\r\n'),
('CHA-312608', 'กระทะเหล็กหล่อ 26 ซม สีแดง', 5100, 'Cast Iron Cookware', 'กระทะเหล็กหล่อ ทำจากเหล็กหล่อและเคลือบสารอีนาเมลเป็นวัสดุพิเศษที่แข็งแรง ทนทาน นำความร้อนดี ทนต่อความร้อนได้สูงไม่บิดเบี้ยว\r\n', 'สามารถใช้งานได้กับทุกแหล่งความร้อน เช่น เตาอบ เตาไฟฟ้า เตาแก๊ส เตาแม่เหล็ก เตาฮาโลเจน\r\n', 'สามารถทำความสะอาดด้วยเครื่องล้างจานได้    \r\n'),
('CHA-329001', 'กระทะเครป 30 ซม', 5500, 'Cast Iron Cookware', 'ผลิตภัณฑ์เครื่องครัวเหล็กหล่อของ Chasseur แต่ละชิ้นนั้นจะไม่ซ้ำกัน เพราะทุกชิ้นนั้นตีพิมพ์และหล่อด้วยมือ\r\n', 'ผลิตภัณฑ์ของ Chasseur นั้นดีที่สุดในด้านของการกระจายความร้อน และเก็บรักษาความร้อน\r\n', 'ทนความร้อนในเตาอบได้ถึง 220 องศาเซลเซียส\r\n'),
('CHA-372208', 'หม้อเหล็กหล่อทรงกลม 22 ซม สีแดง', 9400, 'Cast Iron Cookware', 'หม้อเหล็กหล่อ ที่แข็งแรงทนทาน นำความร้อนได้ดี\r\n', 'สามารถใช้กับทุกแหล่งความร้อน เช่น เตาอบ เตาไฟฟ้า เตาแม่เหล็ก\r\n', 'ขนาดหม้อ 22 เซนติเมตร ความจุ 2.3 ลิตร\r\n'),
('CHA-372408', 'หม้อเหล็กหล่อทรงกลม 24 ซม สีแดง', 10500, 'Cast Iron Cookware', 'หม้อเหล็กหล่อ ที่แข็งแรงทนทาน นำความร้อนได้ดี\r\n', 'สามารถใช้กับทุกแหล่งความร้อน เช่น เตาอบ เตาไฟฟ้า เตาแม่เหล็ก\r\n', 'ความจุ 3.8 ลิตร\r\n'),
('SCA-10205000', 'ชุดหม้อและกระทะเคลือบสารกันติด 3 ชิ้น', 7900, 'Ceramic Titanium Cookware', 'ชุดหม้อและกระทะเคลือบสารกันติด 3 ชิ้น\r\n', 'เคลือบสารกันติดอย่างดี และปลอดภัยจากสาร PFOA \r\n', 'ทนความร้อนได้ถึง 260 องศาเซลเซียส\r\n'),
('SCA-16202440', 'ชุดหม้อและกระทะ 3 ชิ้น', 7300, 'Ceramic Titanium Cookware', 'เคลือบสารกันติดเซรามิกไทเทเนี่ยมอย่างดี และปลอดภัยจากสาร PFOA \r\n', 'ทนความร้อนได้ถึง 260 องศาเซลเซียส\r\n', 'ไม่สามารถใช้งานกับเตา Induction ได้\r\n'),
('SCA-26101204', 'กระทะก้นแบนพร้อมฝาแก้ว', 4960, 'Ceramic Titanium Cookware', 'ทอดโดยไม่ต้องใช้น้ำมัน\r\n', 'พื้นผิวเซรามิคไทเทเนียม ช่วยให้อาหารไม่ติดภาชนะ\r\n', 'เหมาะสำหรับเตาทุกประเภท ยกเว้นเตา induction\r\n'),
('SCA-35321200', 'ถาดอบ 39x27 ซม.', 6180, 'Casseroles', 'กระทะเป็นอลูมิเนียมหล่อเคลือบสารกันติด\r\n', 'ไม่จำเป็นต้องใช้น้ำมันมากเพื่อกันติด\r\n', NULL),
('SCA-36301200', 'กระทะก้นลึก ขนาด 36 ซม.', 7120, 'Ceramic Titanium Cookware', 'กระทะที่เหมาะสำหรับการทำอาหารเอเชียหรืออาหารผัดหรือทอด\r\n', 'กระทะเป็นอลูมิเนียมหล่อเคลือบสารกันติด\r\n', 'ขนาดก้นลึก 36 ซม. พร้อมตะแกรงสะเด็ดน้ำมัน\r\n'),
('SCA-65002000', 'กระทะก้นแบน 20 ซม', 4800, 'Ceramic Titanium Cookware', 'ด้านในเคลือบด้วยเซรามิคไทเทเนี่ยม และสารกันติด ทำให้อาหารไม่ติดภาชนะ\r\n', 'ปลอดสาร PFOA\r\n', 'ทนต่อความร้อนถึง 260 องศาเซลเซียส\r\n'),
('SCA-65231800', 'หม้อด้ามพร้อมฝา ', 7400, 'Ceramic Titanium Cookware', 'พื้นผิว non-stick ป้องกันการติดภาชนะ\r\n', 'ทนความร้อนถึง 260 องเซลเซียส\r\n', 'ความจุ2.5ลิตร เส้นผ่านศูนย์กลาง 18 เซนติเมตร\r\n'),
('SIM-305', 'ภาชนะแก้วพร้อมฝา 2 ขนาด', 1500, 'Casseroles', 'ภาชนะแก้วพร้อมฝา 2 ขนาด \r\n', 'ประกอบด้วย โถพร้อมฝาขนาด 1 ลิตร และ ขนาด 1.5 ลิตร\r\n', NULL),
('SIM-356', 'ชุดภาชนะแก้ว 5 ชิ้น', 2620, 'Casseroles', 'สามารถใช้ได้กับเตาอบได้\r\n', 'สามารถใช้ได้กับเตาไมโครเวฟได้\r\n', 'สามารถใช้กับเครื่องล้างจานได้\r\n');

